import React from "react";

export const AddTodoForm = ({ onAddTodoSubmit, onAddTodoInput }) => (
  <form onSubmit={onAddTodoSubmit} className="my-3 from-inline">
    <label
      htmlFor="addForm"
      style={{
        fontSize: "20px",
        fontWeight: "600",
      }}
    >
      Add your work:
    </label>

    <input
      className=""
      id="addForm"
      type="text"
      placeholder="What do you want to do?"
      onChange={onAddTodoInput}
      autoFocus
    />

    <button className="btn btn-primary" type="submit">
      Submit
    </button>
  </form>
);
